const Total = ({ total, formatToCurrency, currency, currency_codes }) => {
  return (
    <tr>
      <td className={total.class}>&nbsp;</td>
      <td>{total.text}</td>
      <td id={total.value}>
        <span>{currency_codes[0][currency[0]["currency"]]}</span>
        {formatToCurrency(total.value)}
      </td>
    </tr>
  );
};

export default Total;
